import React from 'react';
import { Link } from 'react-router-dom';

import './app-header.css';

const AppHeader = () => {
    const navigation = (e) => {
        e.preventDefault();
    }
    return (
        <header className="header">
            <Link to={'/'} className="h3 text-light">PIPITER</Link>
            <nav className="navbar navbar-light">
                <form className="form-inline" onSubmit={navigation}>
                    <input className="form-control mr-sm-2 " type="search" placeholder="Search" aria-label="Search" />
                    <Link to='/list'><button className="btn btn-outline-secondary my-2 my-sm-0" type="submit"> Search</button></Link>
                </form>
            </nav>
            <Link to='/register'><button className="log btn btn-dark">Sing in</button></Link>
        </header>
    )
}



export default AppHeader;
